import React, { Component } from 'react';
import CustomForm from './components/CustomForm';
import './App.css';


var express = require('express');
var app = express();

app.get('/hello', function(req, res){
   res.send("Hello World!");
});

app.listen(3000);

export default class App extends Component{
  render(){
    return(
      <CustomForm />
    );
  }
}
